import React from "react";
import { Helmet } from "react-helmet";

const Main = ({ children, pageTitle }) => {
  return (
    <div className="ear-health">
      <Helmet>
        <title>{`${pageTitle}`} | Ear Health</title>
      </Helmet>
      {/* Navbar goes here */}
      {children}
      {/* Footer goes here */}
    </div>
  );
};

export default Main
